INSERT INTO public.task (id,project_id,task_status_id,task_priority_id,assigned_user_id,name,description,deadline,created_at,created_by,updated_at,updated_by) VALUES (4908, 484, 3, 2, '0f5d546a-dd80-5406-a005-a4f3061b9fb4', 'Etsi quibus tes parabo', 'In eram num maxim sed rationem legen im. Asperciplin non frui quidemque ut bona, nis anim crudelegan quasi es audivolven it ipsa. Constantia ne non si ear repudincid de est. Epicur praesersas discorrecor est multoque. Laturae quae nullam sed voluptatib odia torquate, at sed metu sed quae deinde.', '2025-10-26T09:26:10.163Z', '2020-07-07T18:41:39.000Z', NULL, '2020-01-25T12:58:26.000Z', NULL), (4909, 484, 3, 2, '44315cac-0a3d-513e-ae25-923183abdce2', 'Autemodioq inquit futur', 'Endarum omos via quid restate, voluptas optarenti ratio inhumilem quisquamquamquam. Si quod in nec voluptatib quadam nostris videt, esse non sent paene sancirco.', '2025-07-12T03:04:24.301Z', '2020-02-06T13:19:02.000Z', NULL, '2020-02-18T13:15:30.000Z', NULL), (4910, 484, 3, 1, '44315cac-0a3d-513e-ae25-923183abdce2', 'Effectus nobisse cum', 'Dici dolenimas natur esse ponsummum meliuste. Cuiquam si posse quia ad, quae recta sed et dam. Repeligit essariae sed appellant locos, nec ab recte cum ophi probatum. Titum ea aliquisti deditat soliditat es, se liberuisse se mnesari sine patre l se. Nec dicerab quod cogitas consecut est placet, non corporrecte sive amicitia bona enimus.', '2025-02-03T04:21:36.308Z', '2020-05-17T04:52:52.000Z', NULL, '2020-12-20T12:13:05.000Z', NULL), (4911, 484, 3, 4, '71c8f57c-aae5-5ac8-8fc0-a1ff399b17b8', 'Reret omnescius qui', 'Is cum omnescio te igione, et hoc probatio horribiliae si feratione iis. Sit postea in virtutem quam tot c aut. Et non gymnasia viti habersia, et parat satureis sed iliuste a. Dicitavis inquit eaque haec quasi er poenis habet. Sed repuditer qui posse debent.', '2025-01-12T01:31:25.699Z', '2020-05-25T04:45:11.000Z', NULL, '2020-08-20T08:05:14.000Z', NULL), (4912, 484, 3, 4, '71c8f57c-aae5-5ac8-8fc0-a1