INSERT INTO public.task (id,project_id,task_status_id,task_priority_id,assigned_user_id,name,description,deadline,created_at,created_by,updated_at,updated_by) VALUES (4972, 495, 2, 1, '0f5d546a-dd80-5406-a005-a4f3061b9fb4', 'Statu dicendus tantum', 'Epicium fugientia aliens est et sic exceperea causa. Nec ut alterpretar voluptatum expetetur, theophrasti nos eo acestiam il semelli insequatur quo. Ad modus et tantum se.', '2025-12-05T15:33:53.022Z', '2020-06-06T17:36:40.000Z', NULL, '2020-06-06T05:22:13.000Z', NULL), (4973, 495, 3, 4, '44315cac-0a3d-513e-ae25-923183abdce2', 'Mentico omnem corporrecus autem propter', 'Postulit tota quibusus efficiatur utrumvis affecto, nostrum sensibus affecta quae facet pro in. Nullam fecerunam omnemo sit orem ad, disseritis ida magis deteret extremum. Sit consule miserudin offician nobis adiuvet omnemo.', '2025-09-05T10:10:05.185Z', '2020-09-05T08:13:26.000Z', NULL, '2020-11-19T10:59:49.000Z', NULL), (4974, 495, 3, 2, '44315cac-0a3d-513e-ae25-923183abdce2', 'Fortiturus omnesque uternumquam ere magnoperno', 'Nihil commodis laetamicur aspertur interea mihi plurimos, uti monstret inquam et non proborum. Voluperet erunum atem et mel.', '2025-02-09T04:59:50.168Z', '2020-07-03T18:21:26.000Z', NULL, '2020-12-16T12:01:29.000Z', NULL), (4975, 495, 3, 2, '71c8f57c-aae5-5ac8-8fc0-a1ff399b17b8', 'Inimi', 'Sit et benivole fieri pedire praeteriuntque, solet nunc vitae esse et omnisi. Homo sit frustra his quando, fectrice dolormidin ad ante exore defuituris facet at. Nihille opus epicium modum hoc es quae aut.', '2025-01-01T12:27:34.838Z', '2020-10-06T21:57:55.000Z', NULL, '2020-09-25T08:31:29.000Z', NULL), (4976, 495, 1, 4, '71c8f57c-aae5-5ac8-8fc0-a1ff399b17b8', 'Genus enim eiusdem sibus', 'Quasi efficillus sit perciplinis eas ipse quodsi rerum. Esse cum a it tam sapiens, menant as ans degenimis legere imo quod.', '2025-06-25T12:05:22.637Z', '2020-02-18T13:41:50.000Z', NULL, '2020-10-22T21:54:13.000Z', NULL), (4977, 495, 2, 3, '5ca75a8e-3605-5166