INSERT INTO public.task (id,project_id,task_status_id,task_priority_id,assigned_user_id,name,description,deadline,created_at,created_by,updated_at,updated_by) VALUES (5109, 512, 2, 3, '0f5d546a-dd80-5406-a005-a4f3061b9fb4', 'Patrioque', 'Il facilis nec extremo c videbitur alique, detracta quae aperet non se. Causam parenim defentibi non arum il cum metu, tur hominum praestabilla eadem fortitudit.', '2025-05-30T03:59:28.680Z', '2020-04-16T15:47:04.000Z', NULL, '2020-12-16T11:30:22.000Z', NULL), (5110, 512, 2, 4, '44315cac-0a3d-513e-ae25-923183abdce2', 'Delapere enimus quia', 'Libent quos invita quicquamquam motu possit addidisque fecta, possine voluptatem praeclare augendi summum. Pugnari non id tractavio confirmisis sit il.', '2025-04-30T11:29:58.797Z', '2020-01-01T12:38:49.000Z', NULL, '2020-08-24T07:20:13.000Z', NULL), (5111, 512, 1, 3, '44315cac-0a3d-513e-ae25-923183abdce2', 'Curationis saxum albuci', 'Et qui ea qui plurim exedicium de, ulent perinter frequenterum meis ignaviamus et voluptas quo. Numenimum qui doloratio dolore adverum, inosophia tempernatur omni et epicur indoctissim fortit. Putandistin et nunc fugiatur est, nostras magis geomet tur in. Sed vicincur tranquilli se democritud divin, nat praesidit exmulti modus tamenita.', '2025-06-30T13:11:05.098Z', '2020-01-01T12:41:29.000Z', NULL, '2020-05-09T16:57:37.000Z', NULL), (5112, 512, 3, 1, '71c8f57c-aae5-5ac8-8fc0-a1ff399b17b8', 'Fortitura quibus maxim ius', 'Hoc rationi sed et ini vitatus voluptatem pacem.', '2025-02-22T02:00:29.641Z', '2020-04-20T15:41:04.000Z', NULL, '2020-03-11T02:39:55.000Z', NULL), (5113, 512, 3, 2, '71c8f57c-aae5-5ac8-8fc0-a1ff399b17b8', 'Quidem philosoper', 'Quid divelem qua expetentur diceret reperation parum studiis.', '2025-02-14T09:57:32.784Z', '2020-11-07T22:33:46.000Z', NULL, '2020-01-21T12:18:24.000Z', NULL), (5114, 512, 2, 4, '5ca75a8e-3605-5166-aa74-4e2e2fc0beef', 'Chrysippe distrahi', 'Sapiens mortalibus laborem quia disserenim sapienum. Animis animosop per voluperud uleristi ari. Maloritiam nimium mundustria et inestiam, foder quid est ne eorum conturbatur de. Sane melius approbet sit potensione ad. Etiam pellant medium efficiis praeterrore viverius epicia, ne ipso iucuna nec provintelleg est a gravis.', '2025-06-29T10:59:17.379Z', '2020-06-10T17:50:29.000Z', NULL, '2020-07-07T18:27:05.000Z', NULL), (5115, 512, 1, 2, '82d62e5d-3a42-5fcc-8eba-42d842fea91a', 'Declinat', 'Es solitis ipsa quaeque haec, prorsus beata prorsuspicor dis tantum quas epicatis. Eius tum vera at ducemus dixit atur numerator, ilii parituram praestabilla et qui. Tribus tes beatae vix poster quosque quod, afferensa en ultimantes stulti reperia quid.', '2025-09-29T07:48:32.323Z', '2020-05-13T16:18:40.000Z', NULL, '2020-02-26T01:53:09.000Z', NULL), (5116, 512, 2, 2, 'b36ab93a-34cf-5d2f-8309-1f65466da6f0', 'Tantum manum deinde', 'Ime nihilla cum quam salut are. Desid non delecta aut tant vidis, legis se eramicur ad omnis sit quae bonum. In bonorum confirmatum quam ete. Expediri inquam e sicutrumvis maximicit mihi nihil sit, et cognitudit cumque ignoratem quietae ere cordant omnia. Adipsi non recteque est postulanim, quam non repellatin ina libere.', '2025-02-13T09:00:55.994Z', '2020-11-19T22:55:17.000Z', NULL, '2020-04-08T04:01:23.000Z', NULL), (5117, 512, 1, 3, '8bb5337a-4ae8-5fe9-834c-d09e97c220b7', 'Gloriosi fieri memore amarbitrer', 'Ad non in ipsas aliquamur. De beatae ratione sine rerum si tur. Latin videmus certamentib nec quam occulpa summam finibusab. Habenime aut lucilia praesenimpor ut apte victi. Modum omni nec admiseran etur aliquid, nulli praeteret vivere tur caecatque neque pecunditat.', '2025-01-24T00:24:08.172Z', '2020-09-09T08:34:00.000Z', NULL, '2020-07-15T18:43:04.000Z', NULL), (5118, 512, 3, 1, '5ca75a8e-3605-5166-aa74-4e2e2fc0beef', 'Esse aut', 'Tam dissermonstret diesque bonum tam inibus, tam fieri ac quae aut praetere sus ut. Praesendi est dolor comparvos hoc dicitas provindivin. Ea fore de adveri consummam in. Ratione non natur putari futur, eo meo velita ficitavi habetur ut cyrenaicosop. Docetiam posse et inpotes aut magis, potest viven undiae nisi gauderit invideantur quae.', '2025-08-26T00:18:03.182Z', '2020-09-17T08:47:46.000Z', NULL, '2020-02-18T01:34:37.000Z', NULL);
